ST.xhtml:
Blink(IN:= Start1, PT:= T#1000MS, Q=> Fin1, ET=> );
Blink2(IN:= Start2, PT:= T#1000MS, Q=> Fin2 , ET=> );
CASE Cyclestate OF	
	0:
		Start1 := TRUE;
		Output1 := TRUE;		
		Fin2 := FALSE;
		Cyclestate := 10;		
	10:
		IF Fin1 THEN
			Start1 := FALSE;
			Output1 := FALSE;			
			Cyclestate := 20;
		ELSE
			Cyclestate := 10;
		END_IF		
	20:
		Start2 := TRUE;
		Cyclestate := 30;
		Fin1 := FALSE;		
	30:
		IF Fin2 THEN
			Start2 := FALSE;
			Cyclestate := 0;
		ELSE
			Cyclestate := 30;
		END_IF
END_CASE
